import React, {useState} from 'react';

const FormularioCadastro = () => {

    const initialData = {
        bairro: '',
        bpm: '',
        cia:'',
        cidade:'',
        data: '',
        lat_lon: '',
        naturezal: '',
        num_rop: '',
        procedimento: '',
        qtde_arma_fogo_ap: '',
        qtde_droga_ap: '',
        qtde_municoes_ap: '',
        qtde_vitima:'',
        tipo:'',
        tipo_2: '',
        tipo_arma: ''
    }

    let {values, setValues} = useState(initialData)

    
    return (
        <h1> FormularioCadastro </h1>
    )
}

export default FormularioCadastro;
